import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <Container fluid>
      <Row>
        <Col>
          <h1>Admin Dashboard</h1>
          <p>Welcome to the admin dashboard.</p>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
